    "text": "Clipper.jl is a Julia wrapper for Angus Johnson\'s Clipper library (ver. 6.2.1).. Clipper - an open source freeware library for clipping and offsetting lines and polygons.The Clipper library performs line & polygon clipping - intersection, union, difference & exclusive-or, and line & polygon offsetting. The library is based on Vatti\'s clipping algorithm."
